Согласно требованиям Национального Банка КР, пользователи электронного кошелька должны быть идентифицированы посредством фотографии онлайн или пройти полную идентификацию в филиалах Коммерческого Банка Кыргызстан.Онлайн идентификация необходима для использования всех функций приложения, как быстрые переводы, обналичивание средств и увеличение максимальной суммы на балансе.

Возможности:
• Увеличение лимитов до 60 000 сомов;
• Быстрые переводы;
• Обналичивание средств;
• Доступ ко всем функциям приложения.
